import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Assuming you're using BrowserRouter

import Home from './pages/home/home'; // Adjusted file paths and case sensitivity
import Note from './pages/Note/note'; // Adjusted file paths and case sensitivity
import About from './pages/about/about'; // Adjusted file paths and case sensitivity
import Content from './pages/content/contact'; // Adjusted file paths and case sensitivity
import Register from './pages/register/register'; // Adjusted file paths and case sensitivity
import Todo from './pages/todo/todo'; // Adjusted file paths and case sensitivity
import TodoEdit from './pages/todoedit/todoedit';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/note" element={<Note />} />
        <Route path="/content" element={<Content />} />
        <Route path="/register" element={<Register />} />
        <Route path="/todo" element={<Todo />} />
        <Route path="/todoedit" element={<TodoEdit />} />
      </Routes>
    </Router>
  );
};

export default App;
